  false,\n\t\"url\": null,\n\t\"notes\": \"The Aransas-Wood Buffalo population of
  whooping cranes (Grus americana) declined to near extinction by the 1940s.  Starting
  in winter 1950u20131951, annual aerial surveys were conducted to observe and record
  the number of whooping cranes wintering on Aransas National Wildlife Refuge (NWR)
  and surrounding areas.  This effort resulted in 38,332 observations of whooping
  crane groups being marked on paper maps between winter 1950u20131951 and winter
  2010u20132011.  We digitized those locations by matching the ArcMap 10 screen display
  as close as possible with the paper maps and approximating points in each of the
  marked locations.  These data are freely available to the public.  However, we caution
  that these data have quality issues and limitations due to, but not limited to,
  inconsistencies and lack of documentation on how data were collected, reliance on
  perceived knowledge of unmarked birdsu2019 identities, and inaccuracies introduced
  during both recording and digitization.  For more information refer to the document
  entitled \"Observations of Whooping Cranes During Winter Aerial Surveys: 1950-2011.\"
